import React from "react";

const TrackItem = (props) => {
  return (
    <li>
      <div>{`${props.title}`}</div>
      <div>
        {props.artists.map((artist) => (
          <span>
            <li>{`${artist.name}`}</li>
          </span>
        ))}
      </div>
    </li>
  );
};

export default TrackItem;
